import styled from "styled-components";


export const Main = styled.div`
.nav_container{
    width: 100%;
    padding-right: 15px;
    padding-left: 15px;
    margin-right: auto;
    margin-left: auto;
    background-color: #242736;
}

.navs {
    /* background: #242736; */
    min-height: 53px;
    overflow: auto;
}
.navs ul {
    margin: 0;
    padding: 0;
    list-style: none;
    margin: auto;
}
.navs li {
    float: left;
}

.navs-mobile{
    margin-left: 8%;
}

.navs-mobile a {
    display: block;
    padding: 9px 6px;
    line-height: 27px;
    color: #fff;
    text-decoration: none;
    font-size: 14px;
}
.tt{
    margin-top: 36px;
}
`;


export const Wrapper = styled.div`
    background: url(${({ image }) => image});
`;


export const Context = styled.div`
    background: url(${({ image }) => image});
    background-repeat: no-repeat;
    background-position: left;
    background-size: 26rem; 
    background-position: bottom;
`;
